import React, {useEffect, useState} from 'react';

import axios from 'axios';

function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        axios.get('https://coronavirus-tracker-api.herokuapp.com/all')
            .then(response => {
                const allThree = response.data.latest;

                setData(allThree)
            })
    }, []);

    return (
        <React.Fragment>
            <nav>
                <h2>Corona Watcher</h2>
            </nav>
            <div className='main'>
                <div className='corona-numbers'>
                    {/*<ul>
                    <li>{data.latest}</li>
                    <li>{data.deaths}</li>
                    <li>{data.recovered}</li>
                </ul>*/}
                </div>
            </div>
            <footer>
                <p>Used the coronavirus-tracker (API)</p>
            </footer>
        </React.Fragment>
    );
}

export default App;
